script: |
  super -f text -I q7509.spq | sort > q7509.out

inputs:
  - name: q7509.spq
    data: |
      SELECT DISTINCT col2 * - 74 FROM tab0 (FORMAT parquet) WHERE NOT ( + col0 ) BETWEEN col0 + col2 AND col1 + - 74 / + 12;
  - name: tab0

outputs:
  - name: q7509.out
    data: |
      -3478
      -7326
      -740
